import React from 'react';
import {
    Table,
    THead,
    TBody,
    TRow
} from "./Table";
import UUID from 'uuidjs';

const TrackTable = ({ cols, items, onClickRow }) => {

    return (
        <Table className="track-table">
            <THead cols={cols} />
            <TBody>
                {(items && items.length > 0) &&
                    items.map((item, index) =>
                        <TRow
                            cols={cols}
                            data={item}
                            key={UUID.genV1()}
                            onClick={onClickRow.bind(index, item.id)} />
                    )
                }
            </TBody>
        </Table>
    )
}

export default TrackTable;
